window.bookSummaryJSON = "<p><b>A teenage student of magical combat gets put to the test against an evil god in the </b><b><i>New York Times</i></b><b> bestselling author’s YA urban fantasy novel.</b></p> <p>As a warrior-in-training at Mythos Academy, I've battled the Reapers of Chaos before—and survived. But this time I have a Bad, Bad Feeling it's going to be a fight to the death. . .most likely mine.</p> <p>Yeah, I've got my psychometry magic, my talking sword, Vic, and even the most dangerous Spartan on campus—Logan Quinn—at my side. But I'm still no match for Loki, the evil Norse god of chaos. I may be Nike's Champion, but at heart, I'm still just Gwen Frost, that weird Oracle girl everyone at school loves to gossip about.</p> <p>Then someone I love is put in more danger than ever before, and something inside me snaps. This time, Loki and his Reapers are going down for good . . . or I am.</p>"; 
